import Header from "./Header";
import Sidebar from "./Sidebar";
import {Outlet} from "react-router-dom";
import Footer from "./Footer";
import {useEffect} from "react";

export default function Layout() {

  useEffect(() => {
    window.M.AutoInit();
  }, []);

  return (
      <>
        <Header/>
        <Sidebar/>
        <main className="container">
          <Outlet/>
        </main>
        <Footer/>
      </>
  )

}
